import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import './App.css';

import uploadUser from './uploadUser';
import employeeDashboard from './employeeDashboard';
import employeeCRUD from './employeeCRUD';

function App() {
  return (
    <div className="App">
      <ul>
        <li><a href="/upload">Upload Users</a></li>
        <li><a href="/dashboard">Employee Dashboard</a></li>
        <li><a href="/crud">CRUD Feature</a></li>
        <li className="floatRight"><a className="active" href="/about">HR Management Portal</a></li>
      </ul>

      <BrowserRouter>
        <Switch>
          <Route path="/upload">
            <uploadUser />
          </Route>
          <Route path="/dashboard">
            <employeeDashboard />
          </Route>
          <Route path="/crud">
            <employeeCRUD />
          </Route>
        </Switch>
      </BrowserRouter>

    </div>
  );
}

export default App;
